import './ExpenseItems.css';

function ExpenseItems() {
  return (
    <div className="expense">
        <div>
            March 28th 2021
        </div>
        <div>
            <h2>Car Insurance</h2>
        </div>
        <div>
            <div>$294.67</div>
        </div>
    </div>
  );
}

export default ExpenseItems;
